    v_type_uint64(F5, [world_time | Path], TrUserData),
    v_type_uint64(F6, [real_time | Path], TrUserData),
    if is_list(F7) ->
           _ = [v_msg_Player(Elem, [player_states | Path], TrUserData) || Elem <- F7],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'Player'}}, F7, [player_states | Path])
    end,
    if is_list(F8) ->
           _ = [v_msg_Player(Elem, [pace_partner_states | Path], TrUserData) || Elem <- F8],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'Player'}}, F8, [pace_partner_states | Path])
